export default function NewMarca() {
    function handleNewMarca() {
        let nombre = document.getElementById("marca_nombre");

        if (nombre.value) {

            postNewMarca(nombre.value);
            nombre.value = "";
        }
        else
            alert("Por favor, rellena todos los campo");
    };

    return (
        <div className="form">
            <h2>Crear Marca</h2>
            <input id="marca_nombre" type="text" placeholder="Nombre" />
            <button onClick={handleNewMarca}>Guardar marca</button>
        </div>
    );
}
